import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses=[
    {id:"e1" ,title:"Car Insurance", amount:294.67,date: new Date(2000,9,13)},
    {id:"e2",title:"Gym", amount:500.00,date: new Date(2000,10,18)},
    {id:"e3",title:"Steam", amount:1600,date: new Date(2000,12,4)},
    {id:"e4",title:"Netflix", amount:100,date: new Date(2000,12,8)}
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
        <ExpenseItem title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date}></ExpenseItem>
        <ExpenseItem title={expenses[1].title}></ExpenseItem>
      <ExpenseItem title={expenses[2].title}></ExpenseItem>
      <ExpenseItem title={expenses[3].title}></ExpenseItem>
    </div>
  );
}

export default App;
